// Â© 2024 Malith Rukshan - https://github.com/Malith-Rukshan

import { useState, useEffect } from 'react'
import Arrow from './Assets/Arrow.tsx';
import React from 'react';
import Tasks from './Assets/Earn.js'; 
import Boosts from './Assets/Boost';
import Frens from './Assets/Frens';
import MyComponent from './componenets/MyComponent.tsx';
import axios from 'axios';
import { v4 as uuidv4 } from 'uuid';
import { AxiosError } from 'axios'; // Import AxiosError


interface UserData {
  _id: string;
  points: number;
  energy: number;
  // ... other properties
}


function App() {
  const [isPressed, setIsPressed] = useState(false);
  const [points, setPoints] = useState(0);
  const [energy, setEnergy] = useState(6500);
  const [clicks, setClicks] = useState<{ id: number, x: number, y: number }[]>([]);
  const [userData, setUserData] = useState<UserData | null>(null);
  const [isLoading, setIsLoading] = useState(true); // Loading state
  const [error, setError] = useState<string | null>(null); 
  const pointsToAdd = 1;
  const energyToReduce = 1;

  useEffect(() => {
    let userId = localStorage.getItem('userId');

    if (!userId) {
      userId = uuidv4();
      localStorage.setItem('userId', userId || '');
    }

    const fetchUserData = async () => {
      try {
        const response = await axios.get<UserData>(`/api/users/${userId}`);
        setUserData(response.data);
      } catch (error) {
        // If the user is new, create a new user document in your database
        if (axios.isAxiosError(error) && error.response?.status === 404) {
          try {
            const newUser = { 
              _id: userId, // Assuming your backend expects _id
              points: 0,
              energy: 6500,
              // ... other initial user data
            };
            await axios.post('/api/users', newUser);
            setUserData(newUser);
          } catch (createError) {
            setError('Failed to create new user');
            console.error(createError);
          }
        } else {
          setError('Failed to load user data');
          console.error(error);
        }
      } finally {
        setIsLoading(false);
      }
    };

    fetchUserData();
  }, []);

  const updateUserData = async (updatedData: Partial<UserData>) => {
    if (userData) {
      try {
        const userId = userData._id;
        await axios.put(`/api/users/${userId}`, updatedData);
        setUserData(prevData => {
          if (prevData) {
            return { ...prevData, ...updatedData };
          } else {
            return null; 
          }
        });
      } catch (error) {
        console.error('Error updating user data:', error);
      }
    } else {
      console.error("Cannot update user data: User not loaded.");
    }
  };

  const [showTasks, setShowTasks] = useState(false);

  const openEarn = () => {
    setShowTasks(!showTasks); 
  };

  const [showBoosts, setShowBoosts] = useState(false);

  const openBoosts = () => {
    setShowBoosts(!showBoosts);
  };


  const [showFrens, setShowFrens] = useState(false);


  const openFrens = () => {
    setShowFrens(!showFrens);
  };


  const handleMouseDown = () => setIsPressed(true);
  const handleMouseUp = () => setIsPressed(false);


  const handleClick = (e: React.MouseEvent<HTMLDivElement, MouseEvent>) => {
    if (energy - energyToReduce < 0) {
      return;
    }
    const rect = e.currentTarget.getBoundingClientRect();
    const x = e.clientX - rect.left;
    const y = e.clientY - rect.top;

    setPoints(points + pointsToAdd);
    setEnergy(energy - energyToReduce < 0 ? 0 : energy - energyToReduce);
    setClicks([...clicks, { id: Date.now(), x, y }]);
    updateUserData({ points: points + pointsToAdd }); 
    updateUserData({ energy: energy - energyToReduce < 0 ? 0 : energy - energyToReduce }); 
  };

  const handleAnimationEnd = (id: number) => {
    setClicks((prevClicks) => prevClicks.filter(click => click.id !== id));
  };

  // useEffect hook to restore energy over time
  useEffect(() => {
    const interval = setInterval(() => {
      setEnergy((prevEnergy) => Math.min(prevEnergy + 1, 6500));
    }, 200); // Resporce energy every 200ms

    return () => clearInterval(interval); // Clear interval on component unmount
  }, []);

  return (
    <div className="bg-gradient-main min-h-screen px-4 flex flex-col items-center text-white font-medium" style={{ userSelect: `none` }}>

      <div className="absolute inset-0 h-1/2 bg-gradient-overlay z-0"></div>
      <div className="absolute inset-0 flex items-center justify-center z-0">
        <div className="radial-gradient-overlay"></div>
      </div>

      <div className="w-full z-10 min-h-screen flex flex-col items-center text-white">

        <div className="fixed top-0 left-0 w-full px-6 pt-8 z-10 flex flex-col items-center text-white">
          <div className="w-full cursor-pointer">
            <div className="bg-[#1f1f1f] text-center py-2 rounded-xl backdrop-blur-md">
              <a href="https://t.me/SingleDevelopers">
                <p className="text-lg">Join squad <Arrow size={18} className="ml-0 mb-1 inline-block" /></p>
              </a>
            </div>
          </div>
          <div className="mt-12 text-5xl font-bold flex items-center">
            <img src='./images/coin.png' width={44} height={44} />
            <span className="ml-2">{points.toLocaleString()}</span>
          </div>
          <div className="text-base mt-2 flex items-center">
            <img src='./images/trophy.png' width={24} height={24} />
            <a href="https://github.com/Malith-Rukshan" target="_blank" rel="noopener noreferrer">
              <span className="ml-1">Gold <Arrow size={18} className="ml-0 mb-1 inline-block" /></span>
            </a>
          </div>
        </div>


        <div className="fixed bottom-0 left-0 w-full px-6 pb-8 z-10">
          <div className="w-full flex justify-between gap-2">
            <div className="w-1/3 flex items-center justify-start max-w-32">
              <div className="flex items-center justify-center">
                <img src='./images/high-voltage.png' width={44} height={44} alt="High Voltage" />
                <div className="ml-2 text-left">
                  <span className="text-white text-2xl font-bold block">{energy}</span>
                  <span className="text-white text-large opacity-75">/ 6500</span>
                </div>
              </div>
            </div>
            <div className="flex-grow flex items-center max-w-60 text-sm">
              <div className="w-full bg-[#fad258] py-4 rounded-2xl flex justify-around">
                <button className="flex flex-col items-center gap-1" onClick={openFrens}>
                  {showFrens && <Frens 
                  showFrens={showFrens} 
                  openFrens={openFrens} 
                  />}
                  <div className="bg-gradient-main ...">
                </div>
                  <img src='./images/bear.png' width={24} height={24} alt="High Voltage"/>
                  <span>Frens</span>
                </button>
                <div className="h-[48px] w-[2px] bg-[#fddb6d]"></div>
                <button className="flex flex-col items-center gap-1" onClick={openEarn}>
                  {showTasks && <Tasks 
                  showTasks={showTasks} 
                  openEarn={openEarn} 
                  onTaskComplete={(reward) => setPoints(points + reward)} 
                  />}
                  <img src='./images/coin.png' width={24} height={24} alt="High Voltage" />
                  <span>Earn</span>
                </button>
                <div className="h-[48px] w-[2px] bg-[#fddb6d]"></div>
                <button className="flex flex-col items-center gap-1" onClick={openBoosts}>
                    {showBoosts && <Boosts 
                    showBoosts={showBoosts} 
                  openBoosts={openBoosts} 
                  onBoostPurchase={(cost) => setPoints(points - cost)} 
                  />}
                  <img src='./images/rocket.png' width={24} height={24} alt="High Voltage" />
                  <span>Boosts</span>
                </button>
              </div>
            </div>
          </div>
          <div className="w-full bg-[#f9c035] rounded-full mt-4">
            <div className="bg-gradient-to-r from-[#f3c45a] to-[#fffad0] h-4 rounded-full" style={{ width: `${(energy / 6500) * 100}%` }}></div>
          </div>
        </div>


        <div className="flex-grow flex items-center justify-center select-none">
          <div className="relative mt-4"
            onClick={handleClick}
            onMouseDown={handleMouseDown}
            onMouseUp={handleMouseUp}
            onMouseLeave={handleMouseUp}
            onTouchStart={handleMouseDown}
            onTouchEnd={handleMouseUp} 
            onTouchCancel={handleMouseUp}>
            <img src='./images/notcoin.png' width={256} height={256} alt="notcoin"
              draggable="false"
              style={{
                pointerEvents: 'none',
                userSelect: 'none',
                transform: isPressed ? 'translateY(4px)' : 'translateY(0px)',
                transition: 'transform 100ms ease',
              }}
              className='select-none'
            />
            {clicks.map((click) => (
              <div
                key={click.id}
                className="absolute text-5xl font-bold opacity-0"
                style={{
                  top: `${click.y - 42}px`,
                  left: `${click.x - 28}px`,
                  animation: `float 1s ease-out`,
                  pointerEvents: `none`
                }}
                onAnimationEnd={() => handleAnimationEnd(click.id)}
              >
                {energyToReduce}
              </div>
            ))}
          </div>
        </div>

      </div>
    </div>
  )
}

export default App
